import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import "../../styles/Truckload.css";

// Import images
import hero1 from "../../assets/gallery/images/gallery1.jpg";
import hero2 from "../../assets/gallery/images/gallery2.jpg";
import hero3 from "../../assets/gallery/images/gallery3.jpg";

import main1 from "../../assets/gallery/images/gallery4.jpg";
import main2 from "../../assets/gallery/images/gallery5.jpg";
import main3 from "../../assets/gallery/images/gallery6.jpg";
import main4 from "../../assets/gallery/images/gallery7.jpg";
import main5 from "../../assets/gallery/images/gallery8.jpg";

function Truckload() {
  // Hero slideshow state
  const heroSlides = [hero1, hero2, hero3];
  const [heroIndex, setHeroIndex] = useState(0);

  // Main slideshow state
  const mainSlides = [main1, main2, main3, main4, main5];
  const [mainIndex, setMainIndex] = useState(0);

  useEffect(() => {
    const heroTimer = setInterval(() => {
      setHeroIndex((prev) => (prev + 1) % heroSlides.length);
    }, 4000);

    const mainTimer = setInterval(() => {
      setMainIndex((prev) => (prev + 1) % mainSlides.length);
    }, 5000);

    return () => {
      clearInterval(heroTimer);
      clearInterval(mainTimer);
    };
  }, []);

  return (
    <div className="rgm-truckload-page">

      {/* HERO */}
      <section className="rgm-truckload-hero">
        {heroSlides.map((img, idx) => (
          <img
            key={idx}
            src={img}
            alt={`Hero ${idx + 1}`}
            className={`hero-slide ${heroIndex === idx ? "active" : ""}`}
          />
        ))}
        <div className="hero-content">
          <h1>Flatbed Truckload Solutions</h1>
          <p>Built on Trust ‚Ä¢ Safety ‚Ä¢ Reliable Flatbed Capacity</p>
        </div>
      </section>

      {/* INTRO */}
      <section className="rgm-truckload-intro">
        <p>
          <strong>RGM Truckload</strong> specializes in full flatbed shipments
          that require experienced drivers, proper securement, and
          dependable communication from pickup to delivery.
        </p>
      </section>

      {/* MAIN SLIDESHOW */}
      <section className="rgm-truckload-main">
        <h2>Main Gallery</h2>
        <div className="main-slideshow">
          {mainSlides.map((img, idx) => (
            <img
              key={idx}
              src={img}
              alt={`Main ${idx + 1}`}
              className={mainIndex === idx ? "active" : ""}
            />
          ))}
        </div>
      </section>

      {/* FEATURES */}
      <section className="rgm-truckload-features">
        <h2>Truckload Key Features</h2>
        <div className="features-grid">
          <div className="feature-card">üöõ Flatbed & Stepdeck Capacity</div>
          <div className="feature-card">üîí Securement-Focused Operations</div>
          <div className="feature-card">üß∞ Construction & Industrial Freight</div>
          <div className="feature-card">üìç Regional & Nationwide Coverage</div>
          <div className="feature-card">üì° Real-Time Load Updates</div>
          <div className="feature-card">ü§ù Trusted Owner-Operators</div>
        </div>
      </section>

      {/* CAPABILITIES */}
      <section className="rgm-truckload-capabilities">
        <h2>Truckload Capabilities</h2>
        <div className="capability-grid">
          <span>48‚Äô & 53‚Äô Flatbed Loads</span>
          <span>Step Deck & Conestoga</span>
          <span>Oversized & Legal Loads</span>
          <span>Construction Materials</span>
          <span>Machinery & Equipment</span>
          <span>Project-Based Freight</span>
        </div>
      </section>

      {/* WHY & FOOTPRINT */}
      <section className="rgm-truckload-why">
        <h2>Why RGM Truckload?</h2>
        <p>
          We may be a growing company, but our approach is simple:
          treat every load like it belongs to family.
        </p>
        <p>
          Clear communication, honest timelines, and safe execution
          are non-negotiable at RGM.
        </p>
      </section>

      <section className="rgm-truckload-footprint">
        <h2>Our Reach</h2>
        <p>
          RGM provides flatbed truckload service across key U.S. corridors,
          supporting regional and long-haul freight with reliable capacity.
        </p>
      </section>

      {/* CTA */}
      <section className="rgm-truckload-cta">
        <h2 className="cta-headline">Ready to Move a Flatbed Load?</h2>
        <p>
          Contact RGM today for dependable flatbed truckload solutions
          built on trust and accountability.
        </p>
        <div className="cta-buttons">
          <Link to="/contact" className="cta-primary">
            Get A Quote
          </Link>
          <Link to="/contact" className="cta-secondary">
            Click to Call
          </Link>
        </div>
      </section>
    </div>
  );
}

export default Truckload;
